document.addEventListener('DOMContentLoaded', () => {

    // ===================================================================
    // 1. ESTADO GLOBAL DE LA APLICACIÓN
    // ===================================================================

    const initialMenuItems = [
        {"id":1,"name":"Frappé de Fresa","category":"frappes","price":8.00,"description":"Dulce y refrescante...","image":"images/frappe_fresa.png","stock":15},
        {"id":2,"name":"Frappé de Naranja","category":"frappes","price":8.00,"description":"Un toque cítrico...","image":"images/frappe_naranja.png","stock":15},
        {"id":3,"name":"Frappé de Chocolate","category":"frappes","price":8.00,"description":"Cremoso e intenso...","image":"images/frappe_chocolate.png","stock":15},
        {"id":4,"name":"Frappé de Coco","category":"frappes","price":8.00,"description":"Sabor tropical...","image":"images/frappe_coco.png","stock":15},
        {"id":5,"name":"Combo 2x1 Frappés","category":"combos","price":15.00,"description":"¡Lleva dos frappés!...","image":"images/combo.png","stock":15},
        {"id":6,"name":"Café Caliente","category":"calientes","price":5.00,"description":"El clásico café...","image":"images/cafe.png","stock":15},
        {"id":7,"name":"Té Caliente","category":"calientes","price":3.00,"description":"Una infusión caliente...","image":"images/te.png","stock":15}
    ];

    // ======================= ESPACIO PARA TU LOGO =======================
    // Pega aquí el código Base64 de tu logo. Déjalo vacío ('') si no tienes uno.
    const logoBase64 = 'data:image/png;base64,'; 
    // ====================================================================

    let menuItems = []; 
    let cart = [];
    let pdfGenerator = null;

    function initApp() {
        listenForStockUpdates();
        loadCartFromStorage();
        setupAllPages();
    }
    
    function listenForStockUpdates() {
        if (typeof database === 'undefined') return;

        const productsRef = database.ref('products');
        productsRef.on('value', (snapshot) => {
            const productsData = snapshot.val();
            if (productsData) {
                menuItems = Object.values(productsData);
            } else {
                console.log("Base de datos vacía. Subiendo stock inicial...");
                menuItems = initialMenuItems;
                productsRef.set(initialMenuItems); 
            }
            renderMenu();
        }, (error) => {
            console.error("Error al leer datos de Firebase: ", error);
            showNotification("No se pudo conectar al servidor de inventario.", "error");
        });
    }

    const updateStockAfterPurchase = (finalizedCart) => {
        const updates = {};
        finalizedCart.forEach(cartItem => {
            const productInDb = menuItems.find(item => item.id === cartItem.id);
            if (productInDb) {
                const newStock = productInDb.stock - cartItem.quantity;
                const productIndex = productInDb.id - 1;
                updates[`products/${productIndex}/stock`] = newStock < 0 ? 0 : newStock;
            }
        });

        return database.ref().update(updates);
    };

    function setupAllPages() {
        setupNavigationAndLogin();
        setupSuccessModal();
        updateCartCounter();
        setupMenuPage();
        setupCartPage();
        setupReservationPage();
    }

    const loadCartFromStorage = () => cart = JSON.parse(localStorage.getItem('shoppingCart')) || [];
    const saveCartToStorage = () => { localStorage.setItem('shoppingCart', JSON.stringify(cart)); updateCartCounter(); };

    const addToCart = (itemId) => {
        const itemInMenu = menuItems.find(i => i.id === itemId);
        if (!itemInMenu || itemInMenu.stock <= 0) {
            return showNotification(`Lo sentimos, ${itemInMenu.name} está agotado.`, 'error');
        }
        
        const itemInCart = cart.find(i => i.id === itemId);
        const quantityInCart = itemInCart ? itemInCart.quantity : 0;
        
        if (quantityInCart >= itemInMenu.stock) {
            return showNotification(`No hay más stock de ${itemInMenu.name}`, 'error');
        }
        
        if (itemInCart) {
            itemInCart.quantity++;
        } else {
            cart.push({ ...itemInMenu, quantity: 1 });
        }
        
        showNotification(`${itemInMenu.name} añadido al carrito!`);
        saveCartToStorage();
        renderMenu();
    };

    const updateCartQuantity = (itemId, newQuantity) => {
        const cartItem = cart.find(i => i.id === itemId);
        if (!cartItem) return;

        const itemInMenu = menuItems.find(i => i.id === itemId);
        if (newQuantity > itemInMenu.stock) {
            newQuantity = itemInMenu.stock;
            showNotification(`Solo quedan ${itemInMenu.stock} unidades de ${itemInMenu.name}.`, 'error');
        }

        if (newQuantity <= 0) {
            cart = cart.filter(i => i.id !== itemId);
        } else {
            cartItem.quantity = newQuantity;
        }

        saveCartToStorage();
        renderCartPage();
        renderMenu();
    };
    
    const updateCartCounter = () => {
        const counter = document.getElementById('cart-counter');
        if (counter) counter.textContent = cart.reduce((sum, item) => sum + item.quantity, 0);
    };

    function renderMenu() {
        const menuGrid = document.getElementById('menu-grid');
        if (!menuGrid) return;
        
        const searchTerm = document.getElementById('search-input')?.value.toLowerCase() || '';
        const category = document.getElementById('category-filter')?.value || 'all';
        
        let itemsToRender = menuItems;
        if (category !== 'all') itemsToRender = itemsToRender.filter(item => item.category === category);
        if (searchTerm) itemsToRender = itemsToRender.filter(item => item.name.toLowerCase().includes(searchTerm));
        
        menuGrid.innerHTML = '';
        if (!itemsToRender || itemsToRender.length === 0) {
            menuGrid.innerHTML = '<p style="text-align: center;">No se encontraron productos.</p>';
            return;
        }
        
        itemsToRender.forEach(item => {
            const quantityInCart = cart.find(ci => ci.id === item.id)?.quantity || 0;
            const currentStock = item.stock;
            const availableStock = currentStock - quantityInCart;
            
            let stockStatus, stockText;
            if (currentStock > 10) { stockStatus = 'available'; stockText = 'Disponible'; } 
            else if (currentStock > 5) { stockStatus = 'few-left'; stockText = `¡Quedan solo ${currentStock}!`; } 
            else if (currentStock > 0) { stockStatus = 'last-units'; stockText = `¡Últimas ${currentStock} unidades!`; } 
            else { stockStatus = 'not-available'; stockText = 'Agotado'; }
            
            const card = document.createElement('div');
            card.className = 'card';
            card.innerHTML = `<img src="${item.image}" alt="${item.name}" class="card-img"><div class="card-body"><h3 class="card-title">${item.name}</h3><p class="card-text">${item.description}</p><div class="card-footer"><div><p class="price">Bs ${item.price.toFixed(2)}</p><span class="stock ${stockStatus}">${stockText}</span></div><button class="add-to-cart-btn" data-id="${item.id}" ${availableStock <= 0 ? 'disabled' : ''}>Añadir</button></div></div>`;
            menuGrid.appendChild(card);
        });
    }
    
    function renderCartPage() {
        const cartItemsList = document.getElementById('cart-items-list');
        if (!cartItemsList) return;
        const cartTotalPrice = document.getElementById('cart-total-price');
        const checkoutBtn = document.getElementById('checkout-btn');
        cartItemsList.innerHTML = '';
        if (cart.length === 0) {
            cartItemsList.innerHTML = '<p>Tu carrito está vacío. <a href="menu.html">¡Ve a llenarlo!</a></p>';
            cartTotalPrice.textContent = 'Bs 0.00';
            checkoutBtn.disabled = true;
            return;
        }
        checkoutBtn.disabled = false;
        let total = 0;
        cart.forEach(item => {
            const itemElement = document.createElement('div');
            itemElement.className = 'cart-item';
            itemElement.innerHTML = `
                <img src="${item.image}" alt="${item.name}" class="cart-item-img">
                <div class="cart-item-info">
                    <h4 class="cart-item-title">${item.name}</h4>
                    <p class="cart-item-price">Bs ${item.price.toFixed(2)}</p>
                </div>
                <div class="cart-item-actions">
                    <div class="quantity-controls">
                        <button class="quantity-btn" data-id="${item.id}" data-action="decrease">-</button>
                        <input type="number" value="${item.quantity}" min="1" max="${item.stock}" data-id="${item.id}" class="quantity-input" readonly>
                        <button class="quantity-btn" data-id="${item.id}" data-action="increase">+</button>
                    </div>
                    <button class="remove-item-btn" data-id="${item.id}">&times;</button>
                </div>`;
            cartItemsList.appendChild(itemElement);
            total += item.price * item.quantity;
        });
        cartTotalPrice.textContent = `Bs ${total.toFixed(2)}`;
    }

    function setupMenuPage() {
        const menuPageContent = document.getElementById('menu-grid');
        if (!menuPageContent) return;
        renderMenu();
        const searchInput = document.getElementById('search-input');
        const categoryFilter = document.getElementById('category-filter');
        if (searchInput) searchInput.addEventListener('input', renderMenu);
        if (categoryFilter) categoryFilter.addEventListener('change', renderMenu);
        menuPageContent.addEventListener('click', e => {
            if (e.target.classList.contains('add-to-cart-btn')) addToCart(Number(e.target.dataset.id));
        });
    }

    function setupCartPage() {
        const cartContainer = document.getElementById('cart-container');
        if (!cartContainer) return;

        cartContainer.addEventListener('click', e => {
            const target = e.target;
            const itemId = Number(target.dataset.id);
            if (target.classList.contains('remove-item-btn')) updateCartQuantity(itemId, 0);
            if (target.classList.contains('quantity-btn')) {
                const action = target.dataset.action;
                const cartItem = cart.find(item => item.id === itemId);
                if (cartItem) {
                    let newQuantity = cartItem.quantity;
                    if (action === 'increase') newQuantity++;
                    else if (action === 'decrease') newQuantity--;
                    updateCartQuantity(itemId, newQuantity);
                }
            }
        });

        const checkoutBtn = document.getElementById('checkout-btn');
        const nameModal = document.getElementById('customer-name-modal');
        const nameForm = document.getElementById('customer-name-form');
        const nameInput = document.getElementById('customer-name-input');
        const nameError = document.getElementById('customer-name-error');

        if (!checkoutBtn || !nameModal || !nameForm || !nameInput) return;

        checkoutBtn.addEventListener('click', () => {
            if (cart.length === 0) return;
            nameError.style.display = 'none';
            nameModal.classList.add('show');
            nameInput.focus();
        });

        nameForm.addEventListener('submit', (e) => {
            e.preventDefault();
            const customerName = nameInput.value.trim();

            if (!customerName) {
                nameError.style.display = 'block';
                return;
            }

            nameModal.classList.remove('show');
            const finalizedCart = [...cart];
            const counterRef = database.ref('dailyOrderCounter');
            
            counterRef.transaction(currentData => {
                if (currentData) {
                    const today = new Date().toISOString().slice(0, 10);
                    if (currentData.lastOrderDate === today) {
                        currentData.count++;
                    } else {
                        currentData.count = 1;
                        currentData.lastOrderDate = today;
                    }
                    return currentData;
                }
                return { count: 1, lastOrderDate: new Date().toISOString().slice(0, 10) };
            
            }).then(result => {
                if (result.committed) {
                    const newOrderNumber = result.snapshot.val().count;
                    updateStockAfterPurchase(finalizedCart);

                    const yourWhatsappNumber = '59174420831'; 
                    let orderMessage = `¡Hola Frappés Valentina! 👋 Pedido a nombre de *${customerName}*:\n\n`;
                    let total = 0;
                    finalizedCart.forEach(item => {
                        orderMessage += `*${item.quantity}x* - ${item.name}\n`;
                        total += item.price * item.quantity;
                    });
                    orderMessage += `\n*TOTAL: Bs ${total.toFixed(2)}*`;
                    const whatsappUrl = `https://wa.me/${yourWhatsappNumber}?text=${encodeURIComponent(orderMessage)}`;
                    window.open(whatsappUrl, '_blank');
                    
                    showSuccessModal('¡Pedido listo!', 'Tu pedido se está procesando. Descarga tu comprobante.', () => generateOrderPDF(finalizedCart, customerName, newOrderNumber));

                    cart = []; 
                    saveCartToStorage(); 
                    renderCartPage();
                    nameInput.value = '';
                }
            });
        });
        renderCartPage();
    }

    function setupReservationPage() {
        const reservationForm = document.getElementById('reservation-form');
        if (!reservationForm) return;

        reservationForm.addEventListener('submit', e => {
            e.preventDefault();
            const reservationData = Object.fromEntries(new FormData(reservationForm).entries());
            const yourWhatsappNumber = '59174420831';
            let total = 0;

            let reservationMessage = `¡Hola Frappés Valentina! 👋 Quisiera hacer una reserva:\n\n*Nombre:* ${reservationData.name}\n*Fecha:* ${reservationData.date}\n*Hora:* ${reservationData.time}\n*Personas:* ${reservationData.guests}\n`;

            if (cart.length > 0) {
                reservationMessage += `\n*--- PRODUCTOS PRE-ORDENADOS ---*\n`;
                cart.forEach(item => {
                    reservationMessage += `*${item.quantity}x* - ${item.name}\n`;
                    total += item.price * item.quantity;
                });
                reservationMessage += `\n*TOTAL (Productos): Bs ${total.toFixed(2)}*\n`;
            }
            reservationMessage += `\n¡Por favor confirmar!`;

            const whatsappUrl = `https://wa.me/${yourWhatsappNumber}?text=${encodeURIComponent(reservationMessage)}`;
            window.open(whatsappUrl, '_blank');
            
            let successMessage = cart.length > 0 ? 'Se abrirá WhatsApp con los detalles de tu reserva y pre-orden.' : 'Se abrirá WhatsApp para que nos envíes los detalles.';

            showSuccessModal('¡Reserva lista!', successMessage, () => generateReservationPDF(reservationData, cart, total));

            reservationForm.reset();
            cart = [];
            saveCartToStorage();
        });
    }

    function setupNavigationAndLogin() {
        const navToggle = document.querySelector('.mobile-nav-toggle');
        const primaryNav = document.getElementById('primary-navigation');
        if (navToggle && primaryNav) {
            navToggle.addEventListener('click', () => {
                const isVisible = primaryNav.getAttribute('data-visible') === 'true';
                primaryNav.setAttribute('data-visible', !isVisible);
                navToggle.setAttribute('aria-expanded', !isVisible);
            });
        }
    }

    function setupSuccessModal() {
        const successModal = document.getElementById('success-modal');
        const closeBtn = document.getElementById('close-success-modal-btn');
        const generatePdfBtn = document.getElementById('generate-pdf-btn');
        if (successModal && closeBtn && generatePdfBtn) {
            closeBtn.addEventListener('click', () => successModal.classList.remove('show'));
            generatePdfBtn.addEventListener('click', () => {
                if (typeof pdfGenerator === 'function') pdfGenerator();
                successModal.classList.remove('show');
            });
        }
    }

    function showSuccessModal(title, message, pdfGenFunc) {
        document.getElementById('success-modal-title').textContent = title;
        document.getElementById('success-modal-message').textContent = message;
        pdfGenerator = pdfGenFunc;
        document.getElementById('success-modal').classList.add('show');
    }

    // ===================================================================
    // FUNCIÓN DE PDF DE PEDIDO - AJUSTADA PARA MEDIA HOJA (A5) Y CENTRADA
    // ===================================================================
    function generateOrderPDF(finalizedCart, customerName, orderNumber) {
        if (typeof window.jspdf === 'undefined') return showNotification("Error: Librería PDF no cargada.", "error");
        if (!finalizedCart || finalizedCart.length === 0) return showNotification("No hay nada que imprimir.", "error");

        const { jsPDF } = window.jspdf;
        const doc = new jsPDF({
            orientation: 'portrait',
            unit: 'mm',
            format: 'a5'
        });

        const pageWidth = doc.internal.pageSize.getWidth();
        const margin = 15;

        if (logoBase64 && logoBase64.startsWith('data:image')) {
            doc.addImage(logoBase64, 'PNG', margin, 10, 30, 30);
        }
        
        doc.setFont('helvetica', 'bold');
        doc.setFontSize(14);
        doc.text('Frappés Valentina', pageWidth - margin, 15, { align: 'right' });
        doc.setFont('helvetica', 'normal');
        doc.setFontSize(9);
        doc.text('Mercado Municipal de Pailón', pageWidth - margin, 21, { align: 'right' });
        doc.text('Santa Cruz, Bolivia', pageWidth - margin, 26, { align: 'right' });
        doc.text('Tel: +591 74420831', pageWidth - margin, 31, { align: 'right' });

        doc.setFontSize(20);
        doc.setFont('helvetica', 'bold');
        doc.text('Comprobante de Pedido', pageWidth / 2, 50, { align: 'center' });
        
        const formattedOrderNumber = String(orderNumber).padStart(3, '0');
        const orderDate = new Date().toLocaleDateString('es-ES', { year: 'numeric', month: 'long', day: 'numeric' });

        doc.setFontSize(10);
        doc.setFont('helvetica', 'normal');
        doc.text(`N° de Pedido: ${formattedOrderNumber}`, margin, 65);
        doc.text(`Fecha: ${orderDate}`, pageWidth - margin, 65, { align: 'right' });
        doc.text(`Cliente: ${customerName}`, margin, 71);

        const tableColumn = ["Producto", "Cantidad", "Precio Unit.", "Subtotal"];
        const tableRows = [];
        let total = 0;
        finalizedCart.forEach(item => {
            const itemTotal = item.price * item.quantity;
            tableRows.push([item.name, item.quantity, `Bs ${item.price.toFixed(2)}`, `Bs ${itemTotal.toFixed(2)}`]);
            total += itemTotal;
        });

        doc.autoTable({
            head: [tableColumn],
            body: tableRows,
            startY: 80,
            theme: 'striped',
            headStyles: { fillColor: [230, 0, 126], textColor: [255, 255, 255], fontStyle: 'bold' },
            styles: { halign: 'center', fontSize: 9 },
            columnStyles: { 0: { halign: 'left' }, 2: { halign: 'right' }, 3: { halign: 'right' } }
        });

        const finalY = doc.lastAutoTable.finalY;
        doc.setFontSize(12);
        doc.setFont('helvetica', 'bold');
        doc.text(`Total a Pagar: Bs ${total.toFixed(2)}`, pageWidth - margin, finalY + 12, { align: 'right' });

        doc.setFontSize(9);
        doc.setFont('helvetica', 'italic');
        doc.text("¡Gracias por tu compra!", pageWidth / 2, doc.internal.pageSize.getHeight() - 10, { align: 'center' });

        doc.output('dataurlnewwindow');
    }

    // ===================================================================
    // FUNCIÓN DE PDF DE RESERVA - AJUSTADA PARA MEDIA HOJA (A5) Y CENTRADA
    // ===================================================================
    function generateReservationPDF(data, reservedCart, total) {
        if (typeof window.jspdf === 'undefined') return showNotification("Error: Librería PDF no cargada.", "error");

        const { jsPDF } = window.jspdf;
        const doc = new jsPDF({
            orientation: 'portrait',
            unit: 'mm',
            format: 'a5'
        });
        
        const pageWidth = doc.internal.pageSize.getWidth();
        const margin = 15;
        let finalY = 0;
        
        if (logoBase64 && logoBase64.startsWith('data:image')) {
            doc.addImage(logoBase64, 'PNG', margin, 10, 30, 30);
        }
        
        doc.setFont('helvetica', 'bold');
        doc.setFontSize(14);
        doc.text('Frappés Valentina', pageWidth - margin, 15, { align: 'right' });
        doc.setFont('helvetica', 'normal');
        doc.setFontSize(9);
        doc.text('Mercado Municipal de Pailón', pageWidth - margin, 21, { align: 'right' });
        doc.text('Santa Cruz, Bolivia', pageWidth - margin, 26, { align: 'right' });
        doc.text('Tel: +591 74420831', pageWidth - margin, 31, { align: 'right' });
        
        doc.setFontSize(20);
        doc.setFont('helvetica', 'bold');
        doc.text('Comprobante de Reserva', pageWidth / 2, 55, { align: 'center' });
        
        const issueDate = new Date().toLocaleDateString('es-ES', { year: 'numeric', month: 'long', day: 'numeric' });
        doc.setFontSize(10);
        doc.setFont('helvetica', 'normal');
        doc.text(`Fecha de Emisión: ${issueDate}`, margin, 70);

        const reservationDetails = [
            ['Nombre:', data.name],
            ['Fecha de la Reserva:', new Date(data.date + 'T00:00:00').toLocaleDateString('es-ES', { weekday: 'long', day: 'numeric', month: 'long' })],
            ['Hora:', data.time],
            ['Personas:', data.guests]
        ];
        
        doc.autoTable({
            body: reservationDetails,
            startY: 75,
            theme: 'plain',
            styles: { fontSize: 11 },
            columnStyles: { 0: { fontStyle: 'bold', halign: 'right' }, 1: { halign: 'left' } }
        });
        finalY = doc.lastAutoTable.finalY;

        if (reservedCart && reservedCart.length > 0) {
            doc.setFontSize(12);
            doc.setFont('helvetica', 'bold');
            doc.text('Productos Pre-ordenados', 14, finalY + 12);

            const tableColumn = ["Producto", "Cantidad", "Precio Unit.", "Subtotal"];
            const tableRows = [];
            reservedCart.forEach(item => {
                tableRows.push([item.name, item.quantity, `Bs ${item.price.toFixed(2)}`, `Bs ${(item.price * item.quantity).toFixed(2)}`]);
            });

            doc.autoTable({
                head: [tableColumn],
                body: tableRows,
                startY: finalY + 17,
                theme: 'striped',
                headStyles: { fillColor: [156, 39, 176], textColor: [255, 255, 255], fontStyle: 'bold' },
                styles: { halign: 'center', fontSize: 9 },
                columnStyles: { 0: { halign: 'left' }, 2: { halign: 'right' }, 3: { halign: 'right' } }
            });
            finalY = doc.lastAutoTable.finalY;

            doc.setFontSize(11);
            doc.setFont('helvetica', 'bold');
            doc.text(`Total Productos: Bs ${total.toFixed(2)}`, pageWidth - margin, finalY + 10, { align: 'right' });
        }

        doc.setFontSize(12);
        doc.setFont('helvetica', 'bold');
        doc.text(["¡Te esperamos!"], pageWidth / 2, doc.internal.pageSize.getHeight() - 20, { align: 'center' });
        
        doc.setFontSize(9);
        doc.setFont('helvetica', 'normal');
        doc.text(["Por favor, presenta este comprobante al llegar.", "Si necesitas cancelar o modificar, contáctanos."], pageWidth / 2, doc.internal.pageSize.getHeight() - 15, { align: 'center' });
        
        doc.output('dataurlnewwindow');
    }

    function showNotification(message, type = 'success') {
        const el = document.getElementById('notification');
        if (!el) return;
        el.textContent = message;
        el.style.backgroundImage = type === 'error' ? 'linear-gradient(to right, #D32F2F, #E64A19)' : 'var(--gradiente-principal)';
        el.classList.add('show');
        setTimeout(() => el.classList.remove('show'), 3000);
    };
    
    initApp();
});